css:
@-moz-document domain("youtube.com") {
.ytp-scrubber-button
  {
    background: url("https://cdn.discordapp.com/attachments/819528017294131221/935183693167861810/ezgif.com-gif-maker.gif")! important;
    background-repeat: no-repeat! important;
    width: 115px! important;
    height: 115px! important;
    margin-left: -60px! important;
    margin-top: -87px! important;
    transform: scale(0.6)! important;
   }
.html5-play-progress, .ytp-play-progress {
   background: #ffa37b !important; 
}
.ytp-volume-slider-track, .ytp-volume-slider-handle:before {
   background: #ffa37b !important;
   z-index: -117;
}
.html5-load-progress, .ytp-load-progress {
   background:  url("https://cdn.discordapp.com/attachments/819528017294131221/935723413677416498/ezgif.com-gif-maker.gif") !important;
}
.html5-progress-list, .ytp-progress-list, .video-ads .html5-progress-list.html5-ad-progress-list, .video-ads .ytp-progress-list.ytp-ad-progress-list {
   height: 12px !important;
}
}
